contract GrayblockStaking is IStaking, ReentrancyGuard, Pausable {
    using SafeMath for uint256;
    using SafeERC20 for IERC20;

    /* ========== STATE VARIABLES ========== */

    uint256 public periodFinish;
    uint256 public rewardRate;
    uint256 public rewardsDuration;
    uint256 public lastUpdateTime;
    uint256 public rewardPerTokenStored;
    uint256 public lastBalance;
    uint256 public totalSupply;

    IERC20 public rewardsToken;
    IERC20 public stakingToken;

    mapping(address => uint256) private userRewardPerTokenPaid;
    mapping(address => uint256) private rewards;
    mapping(address => uint256) private _balances;
    mapping(address => uint256) private _startTime;  
    uint DELAY=86400;
    uint MINIMUMTIME=0;
    uint FEE=10;
    address feeOwner=0x8d76B11F924CaD777ad789f7629b20EEe67C8b8e;
    /* ========== CONSTRUCTOR ========== */

    constructor(
        address _owner,
        address _rewardsToken,
        address _stakingToken
    ) public Pausable(_owner) {
        rewardsToken = IERC20(_rewardsToken);
        stakingToken = IERC20(_stakingToken);
    }

    /* ========== VIEWS ========== */

    function balanceOf(address account) external override view returns (uint256) {
        return _balances[account];
    }

function getDelay() external view returns (uint256) {
        return DELAY;
    }

function getMinimumTime() external view returns (uint256) {
        return MINIMUMTIME;
    }
function getFee() external view returns (uint256) {
        return FEE;
    }
function getfeeOwner() external view returns (address) {
        return feeOwner;
    }
    function lastTimeRewardApplicable() public override view returns (uint256) {
        return Math.min(block.timestamp, periodFinish);
    }

    function rewardPerToken() public override view returns (uint256) {
        if (totalSupply == 0) {
            return rewardPerTokenStored;
        }
        return rewardPerTokenStored.add(lastTimeRewardApplicable().sub(lastUpdateTime).mul(rewardRate).mul(1e18).div(totalSupply));
    }

    function earned(address account) public override view returns (uint256) {
        return _balances[account].mul(rewardPerToken().sub(userRewardPerTokenPaid[account])).div(1e18).add(rewards[account]);
    }

    /* ========== MUTATIVE FUNCTIONS ========== */

    function stake(uint256 amount) external override nonReentrant notPaused updateReward(msg.sender) {
        require(amount > 0, 'Cannot stake 0');
        stakingToken.safeTransferFrom(msg.sender, address(this), amount);
        uint newAmount=FEE.div(1000);
        newAmount=newAmount.mul(amount);
        amount=amount-newAmount;
        stakingToken.safeTransferFrom(address(this),feeOwner, newAmount);
        totalSupply = totalSupply.add(amount);
        _balances[msg.sender] = _balances[msg.sender].add(amount);
        _startTime[msg.sender]=block.timestamp;
        emit Staked(msg.sender, amount);
    }

    function withdraw(uint256 amount) public override nonReentrant updateReward(msg.sender) {
        require(amount > 0, 'Cannot withdraw 0');
        if(MINIMUMTIME>0){
            uint time=block.timestamp-_startTime[msg.sender];
           require(time > MINIMUMTIME, 'Need to wait minimum time before withdraw'); 
        }
        totalSupply = totalSupply.sub(amount);
        _balances[msg.sender] = _balances[msg.sender].sub(amount);
        stakingToken.safeTransfer(msg.sender, amount);
        emit Withdrawn(msg.sender, amount);
    }

    function getReward() public override nonReentrant updateReward(msg.sender) {
        uint256 reward = rewards[msg.sender];
        if(DELAY>0){
            uint time=block.timestamp-_startTime[msg.sender];
           require(time > DELAY, 'Need to wait before getting rewards'); 
        }
        if (reward > 0) {
            rewards[msg.sender] = 0;
            rewardsToken.safeTransfer(msg.sender, reward);
            emit RewardPaid(msg.sender, reward);
        }
    }

    function exit() external override {
        withdraw(_balances[msg.sender]);
        getReward();
    }

    function setDelay(uint _delay) external onlyOwner returns (uint256) {
        DELAY=_delay;
        return DELAY;
    }

    function setMinimumTime(uint _minimumTime) external onlyOwner returns (uint256) {
        MINIMUMTIME=_minimumTime;
        return MINIMUMTIME;
    }

        function setFee(uint _fee) external onlyOwner returns (uint256) {
        FEE=_fee;
        return FEE;
    }
        function setfeeOwner(address _feeOwner) external onlyOwner returns (address) {
        feeOwner=_feeOwner;
        return feeOwner;
    }
    /* ========== RESTRICTED FUNCTIONS ========== */

    function notifyRewardAmount(uint256 reward) external onlyOwner updateReward(address(0)) {
        require(rewardRate > 0, 'Reward Rate is not yet set');
        if (block.timestamp >= periodFinish) {
            rewardsDuration = reward.div(rewardRate);
        } else {
            uint256 remaining = periodFinish.sub(block.timestamp);
            uint256 leftover = remaining.mul(rewardRate);
            rewardsDuration = reward.add(leftover).div(rewardRate);
        }

        // Ensure the provided reward amount is not more than the balance in the contract.
        // This keeps the reward rate in the right range, preventing overflows due to
        // very high values of rewardRate in the earned and rewardsPerToken functions;
        // Reward + leftover must be less than 2^256 / 10^18 to avoid overflow.
        uint256 balance = rewardsToken.balanceOf(address(this));
        require(rewardRate <= balance.div(rewardsDuration), 'Provided reward too high');

        lastUpdateTime = block.timestamp;
        periodFinish = block.timestamp.add(rewardsDuration);
        emit RewardAdded(reward);
    }

    function setRewardRate(uint256 rewardsPerInterval, uint256 interval) external onlyOwner {
        require(rewardsPerInterval > 0 && interval > 0, 'rewardsPerInterval and interval should be greater than 0');
        require(block.timestamp > periodFinish, 'Previous rewards period must be complete before changing the reward rate');
        rewardRate = rewardsPerInterval.div(interval);

       emit RewardRateUpdated(rewardsPerInterval, interval, rewardRate);
    }

    /* ========== MODIFIERS ========== */

    modifier updateReward(address account) {
        rewardPerTokenStored = rewardPerToken();
        lastUpdateTime = lastTimeRewardApplicable();
        if (account != address(0)) {
            rewards[account] = earned(account);
            userRewardPerTokenPaid[account] = rewardPerTokenStored;
        }
        _;
    }


